pub fn search(tag: Tag) -> Option<&'static DictionaryItem> {
    if tag.group() % 2 != 0 {
        // 
        return None;
    }

    {
        let tag = ((tag.group() as u32) << 16) | (tag.element() as u32);
        if DICTIONARY.contains_key(&tag) {
            return DICTIONARY.get(&tag);
        }
    }

    if tag.element() == 0x0000 {
        return Some(&GROUP_LENGTH);
    }

    match tag.group() {
        0x0020 => match tag.element() & 0xff00 {
            0x3100 => Some(&SOURCE_IMAGE_IDS),
            _ => None,
        },
        0x0028 => match tag.element() & 0xff0f {
            0x0400 => Some(&ROWS_FOR_NTH_ORDER_COEFFICIENTS),
            0x0401 => Some(&COLUMNS_FOR_NTH_ORDER_COEFFICIENTS),
            0x0402 => Some(&COEFFICIENT_CODING),
            0x0403 => Some(&COEFFICIENT_CODING_POINTERS),
            0x0800 => Some(&CODE_LABEL),
            0x0802 => Some(&NUMBER_OF_TABLES),
            0x0803 => Some(&CODE_TABLE_LOCATION),
            0x0804 => Some(&BITS_FOR_CODE_WORD),
            0x0808 => Some(&IMAGE_DATA_LOCATION),
            _ => None,
        },
        0x1000 => match tag.element() & 0x000f {
            0x0000 => Some(&ESCAPE_TRIPLET),
            0x0001 => Some(&RUN_LENGTH_TRIPLET),
            0x0002 => Some(&HUFFMAN_TABLE_SIZE),
            0x0003 => Some(&HUFFMAN_TABLE_TRIPLET),
            0x0004 => Some(&SHIFT_TABLE_SIZE),
            0x0005 => Some(&SHIFT_TABLE_TRIPLET),
            _ => None,
        },
        0x1010 => Some(&ZONAL_MAP),
        _ => match tag.group() & 0xff00 {
            0x5000 => match tag.element() {
                0x0005 => Some(&CURVE_DIMENSIONS),
                0x0010 => Some(&NUMBER_OF_POINTS),
                0x0020 => Some(&TYPE_OF_DATA),
                0x0022 => Some(&CURVE_DESCRIPTION),
                0x0030 => Some(&AXIS_UNITS),
                0x0040 => Some(&AXIS_LABELS),
                0x0103 => Some(&DATA_VALUE_REPRESENTAION),
                0x0104 => Some(&MINIMUM_COORDINATE_VALUE),
                0x0105 => Some(&MAXIMUM_COORDINATE_VALUE),
                0x0106 => Some(&CURVE_RANGE),
                0x0110 => Some(&CURVE_DATA_DESCRIPTOR),
                0x0112 => Some(&COORDINATE_START_VALUE),
                0x0114 => Some(&COORDINATE_STEP_VALUE),
                0x1001 => Some(&CURVE_ACTIVATION_LAYER),
                0x2000 => Some(&AUDIO_TYPE),
                0x2002 => Some(&AUDIO_SAMPLE_FORMAT),
                0x2004 => Some(&NUMBER_OF_CHANNELS),
                0x2006 => Some(&NUMBER_OF_SAMPLES),
                0x2008 => Some(&SAMPLE_RATE),
                0x200a => Some(&TOTAL_TIME),
                0x200c => Some(&AUDIO_SAMPLE_DATA),
                0x200e => Some(&AUDIO_COMMENTS),
                0x2500 => Some(&CURVE_LABEL),
                0x2600 => Some(&CURVE_REFERENCED_OVERLAY_SEQUENCE),
                0x2610 => Some(&CURVE_REFERENCED_OVERLAY_GROUP),
                0x3000 => Some(&CURVE_DATA),
                _ => None,
            },
            0x6000 => match tag.element() {
                0x0010 => Some(&OVERLAY_ROWS),
                0x0011 => Some(&OVERLAY_COLUMNS),
                0x0012 => Some(&OVERLAY_PLANES),
                0x0015 => Some(&NUMBER_OF_FRAMES_IN_OVERLAY),
                0x0022 => Some(&OVERLAY_DESCRIPTION),
                0x0040 => Some(&OVERLAY_TYPE),
                0x0045 => Some(&OVERLAY_SUBTYPE),
                0x0050 => Some(&OVERLAY_ORIGIN),
                0x0051 => Some(&IMAGE_FRAME_ORIGIN),
                0x0052 => Some(&OVERLAY_PLANE_ORIGIN),
                0x0060 => Some(&OVERLAY_COMPRESSION_CODE),
                0x0061 => Some(&OVERLAY_COMPRESSION_ORIGINATOR),
                0x0062 => Some(&OVERLAY_COMPRESSION_LABEL),
                0x0063 => Some(&OVERLAY_COMPRESSION_DESCRIPTION),
                0x0066 => Some(&OVERLAY_COMPRESSION_STEP_POINTERS),
                0x0068 => Some(&OVERLAY_REPEAT_INTERVAL),
                0x0069 => Some(&OVERLAY_BITS_GROUPED),
                0x0100 => Some(&OVERLAY_BITS_ALLOCATED),
                0x0102 => Some(&OVERLAY_BIT_POSITION),
                0x0110 => Some(&OVERLAY_FORMAT),
                0x0200 => Some(&OVERLAY_LOCATION),
                0x0800 => Some(&OVERLAY_CODE_LABEL),
                0x0802 => Some(&OVERLAY_NUMBER_OF_TABLES),
                0x0803 => Some(&OVERLAY_CODE_TABLE_LOCATION),
                0x0804 => Some(&OVERLAY_BITS_FOR_CODE_WORD),
                0x1001 => Some(&OVERLAY_ACTIVATION_LAYER),
                0x1100 => Some(&OVERLAY_DESCRIPTOR_GRAY),
                0x1101 => Some(&OVERLAY_DESCRIPTOR_RED),
                0x1102 => Some(&OVERLAY_DESCRIPTOR_GREEN),
                0x1103 => Some(&OVERLAY_DESCRIPTOR_BLUE),
                0x1200 => Some(&OVERLAYS_GRAY),
                0x1201 => Some(&OVERLAYS_RED),
                0x1202 => Some(&OVERLAYS_GREEN),
                0x1203 => Some(&OVERLAYS_BLUE),
                0x1301 => Some(&ROI_AREA),
                0x1302 => Some(&ROI_MEAN),
                0x1303 => Some(&ROI_STANDARD_DEVIATION),
                0x1500 => Some(&OVERLAY_LABEL),
                0x3000 => Some(&OVERLAY_DATA),
                0x4000 => Some(&OVERLAY_COMMENTS),
                _ => None,
            },
            0x7f00 => match tag.element() {
                0x0010 => Some(&VARIABLE_PIXEL_DATA),
                0x0011 => Some(&VARIABLE_NEXT_DATA_GROUP),
                0x0020 => Some(&VARIABLE_COEFFICIENTS_SDVN),
                0x0030 => Some(&VARIABLE_COEFFICIENTS_SDHN),
                0x0040 => Some(&VARIABLE_COEFFICIENTS_SDDN),
                _ => None,
            },
            _ => None,
        },
    }
}

#[cfg(test)]
mod tests {
    use super::*;

    #[test]
    fn test_search() {
        {
            let expected = DictionaryItem {
                name: "Specific Character Set",
                vr: "CS",
                vm: "1-n",
                remarks: "",
            };

            let actual = search(Tag(0x0008, 0x0005)).unwrap();

            assert_eq!(expected, *actual);
        }

        {
            let expected = OVERLAY_DATA;

            let actual = search(Tag(0x6000, 0x3000)).unwrap();

            assert_eq!(expected, *actual);
        }

        {
            let expected = GROUP_LENGTH;

            let actual = search(Tag(0x0008, 0x0000)).unwrap();

            assert_eq!(expected, *actual);
        }

        {
            let expected = None;

            let actual = search(Tag(0x0001, 0x0001));

            assert_eq!(expected, actual);
        }

        {
            let expected = None;

            let actual = search(Tag(0x0000, 0x0001));

            assert_eq!(expected, actual);
        }
    }
}
